description:
Emily and Nicholas, two hard-working Londoners, a few days took time off in Venice to recover from the stress of their jobs. The two are overwhelmed by the wild magic of the carnival which is already in full swing. But the &quot;masks&quot; hide scheming and perverse instincts, just waiting to be &quot;liberated&quot;. A compelling film from master director J.F. Romagnoli, who has created a colorful atmosphere and radiant with the scent of sin that puts viewers in its spell...

